import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Table/navbar';
import HelloWorld from './Table/helloworld';
import Wilaya from './Table/wilaya';
import './App.css';
import { SessionContext } from './session';
function App() {
  // État pour la gestion de la connexion
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Fonction pour se connecter
  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  // Fonction pour se déconnecter
  const handleLogout = () => {
    setIsLoggedIn(false);
  };

  return (
    <Router>
      <SessionContext>
        <div>
          <Navbar/>
          <div className="mt-20"></div>
          <Routes>
            <Route path="/" element={<HelloWorld />} />
            <Route path="/wilaya" element={<Wilaya />} />
          </Routes>
        </div>
      </SessionContext>
    </Router>
  );
}

export default App;
